--
-- Create procedure `Proc_Inventory_GetByFilter`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Inventory_GetByFilter (IN $Keyword varchar(100), -- Dữ liệu tìm kiếm
IN $PageSize int,  -- Số bản ghi hiển thị trong một trang
IN $PageNumber int -- Số trang
)
BEGIN
  DECLARE $Offset int;

  -- SET giá trị mặc định
  IF $Keyword IS NULL
    OR $Keyword REGEXP '--|ORDER BY|GROUP BY|LIMIT' THEN
    SET $Keyword = '';
  END IF;

  IF $PageSize IS NULL
    OR $PageSize <= 0
    OR $PageSize REGEXP '[A-Za-z-]' THEN
    SET $PageSize = 20;
  END IF;

  IF $PageNumber IS NULL
    OR $PageNumber <= 0
    OR $PageNumber REGEXP '[A-Za-z-]' THEN
    SET $PageNumber = 1;
  END IF;

  -- SET điểm bắt đầu 
  SET $Offset = ($PageNumber - 1) * $PageSize;

  -- Câu lệnh truy vấn trả về tổng số bản ghi thoả mãn điều kiện
  SELECT
    COUNT(i.InventoryID)
  FROM inventory i
  WHERE (i.InventoryCode LIKE CONCAT('%', $Keyword, '%')
  OR i.InventoryName LIKE CONCAT('%', $Keyword, '%'));

  -- Câu lệnh truy vấn trả về dữ liệu phân trang
  SELECT
    InventoryID,
    InventoryCode,
    InventoryName,
    Quantity,
    Cost,
    InventoryCategoryID,
    InventoryCategoryCode,
    InventoryCategoryName,
    Description,
    Image
  FROM inventory
  WHERE (InventoryCode LIKE CONCAT('%', $Keyword, '%')
  OR InventoryName LIKE CONCAT('%', $Keyword, '%'))
  ORDER BY ModifiedDate DESC
  LIMIT $PageSize
  OFFSET $Offset;
END
$$

