PROCEDURE Proc_Inventory_DeleteByIDs (IN $InventoryIDs varchar(2000))
BEGIN
  DECLARE $Result varchar(2000);
  SET $Result = REPLACE($InventoryIDs, '"', '');

  DELETE
    FROM inventory
  WHERE InventoryID IN (SELECT
