--
-- Create procedure `Proc_Inventory_CheckDuplicateCode`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Inventory_CheckDuplicateCode (IN $InventoryID char(36),
IN $InventoryCode varchar(20))
BEGIN
  IF $InventoryID IS NULL THEN
    SET $InventoryID = '';
  END IF;

  SELECT
    EXISTS (SELECT
        i.InventoryID
      FROM inventory i
      WHERE i.InventoryCode = $InventoryCode
      AND i.InventoryID <> $InventoryID);
END
$$

