--
-- Create procedure `Proc_Employee_GetByFilter`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Employee_GetByFilter (IN $Keyword varchar(100), -- Dữ liệu tìm kiếm
IN $PageSize int,  -- Số bản ghi hiển thị trong một trang
IN $PageNumber int -- Số trang
)
BEGIN
  -- Auth: TTTuan
  -- Created date: 22/12/2022
  -- Desc: Lấy danh sách nhân viên theo mã, tên, đt di động, đt cố định của nhân viên
  -- Modified by: TTTuan (22/12/2022)
  -- Running test: CALL Proc_Employee_GetByFilter('02168859', 20, 1)

  DECLARE $Offset int;

  -- SET giá trị mặc định
  IF $Keyword IS NULL
    OR $Keyword REGEXP '--|ORDER BY|GROUP BY|LIMIT' THEN
    SET $Keyword = '';
  END IF;

  IF $PageSize IS NULL
    OR $PageSize <= 0
    OR $PageSize REGEXP '[A-Za-z-]' THEN
    SET $PageSize = 20;
  END IF;

  IF $PageNumber IS NULL
    OR $PageNumber <= 0
    OR $PageNumber REGEXP '[A-Za-z-]' THEN
    SET $PageNumber = 1;
  END IF;

  -- SET điểm bắt đầu 
  SET $Offset = ($PageNumber - 1) * $PageSize;

  -- Câu lệnh truy vấn trả về tổng số bản ghi thoả mãn điều kiện
  SELECT
    COUNT(e.EmployeeID)
  FROM employee e
  WHERE (e.EmployeeCode LIKE CONCAT('%', $Keyword, '%')
  OR e.EmployeeName LIKE CONCAT('%', $Keyword, '%')
  OR e.Phone LIKE CONCAT('%', $Keyword, '%'));

  -- Câu lệnh truy vấn trả về dữ liệu phân trang
  SELECT
    e.EmployeeID,
    e.EmployeeCode,
    e.EmployeeName,
    e.JobPosition,
    e.DateOfBirth,
    e.Gender,
    e.IdentityNumber,
    e.IdentityDate,
    e.IdentityPlace,
    e.Address,
    e.Phone,
    e.Email,
    e.BankNumber,
    e.BankName,
    e.BankBranch
  FROM employee e
  WHERE (e.EmployeeCode LIKE CONCAT('%', $Keyword, '%')
  OR e.EmployeeName LIKE CONCAT('%', $Keyword, '%'))
  OR e.Phone LIKE CONCAT('%', $Keyword, '%')
  ORDER BY e.ModifiedDate DESC
  LIMIT $PageSize
  OFFSET $Offset;
END
$$

