--
-- Create procedure `Proc_Employee_DeleteByIDs`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Employee_DeleteByIDs (IN $EmployeeIDs varchar(2000) -- Chuỗi danh sách ID nhân viên
)
BEGIN
  -- Auth: TTTuan
  -- Created date: 22/12/2022
  -- Desc: Xoá nhiều nhân viên theo danh sách ID
  -- Modified by: TTTuan (22/12/2022)
  -- Running test: CALL Proc_Employee_DeleteByIDs('1343d389-1cc2-4ab7-88f6-423b4e874d0f,1343d389-1cc2-4ab7-88f6-423b4e874d0f,1343d389-1cc2-4ab7-88f6-423b4e874d0f')

  DECLARE $Result varchar(2000);
  SET $Result = REPLACE($EmployeeIDs, '"', '');

  DELETE
    FROM employee
  WHERE EmployeeID IN (SELECT
        EID
      FROM (SELECT
          EmployeeID AS EID
        FROM employee
        WHERE FIND_IN_SET(EmployeeID, $Result)) AS E);
END
$$

