--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Employee_CheckDuplicateCode (IN $EmployeeID char(36), -- ID nhân viên
IN $EmployeeCode varchar(20) -- Mã nhân viên
)
BEGIN
  -- Auth: TTTuan
  -- Created date: 22/12/2022
  -- Desc: Lấy danh sách nhân viên theo mã, tên, đt di động, đt cố định của nhân viên
  -- Modified by: TTTuan (3/1/2022)
  -- Running test: CALL Proc_Employee_DuplicateCode(null, 'NV00001')

  IF $EmployeeID IS NULL THEN
    SET $EmployeeID = '';
  END IF;

  SELECT
    EXISTS (SELECT
        e.EmployeeID
      FROM employee e
      WHERE e.EmployeeCode = $EmployeeCode
      AND e.EmployeeID <> $EmployeeID);
END
$$

